This #SharkWeek, take action and sign the #petition to stop the  Killing of Endangered Sharks in Costa Rica:(link in bio). Costa Rica is home to dozens of shark species, many of which are in serious danger of being overfished to extinction. Earlier this year, President Carlos Alvarado removed the ability of the Ministry of Environment to protect sharks, gutting vital protections and leaving endangered sharks vulnerable to extinction. One of the most at-risk species is the critically endangered hammerhead shark that could become extinct within the next 20 years if no action is taken. Please show your support by signing the petition and sharing the campaign. (link in bio)

